DROP TABLE IF EXISTS `tbl_cms_navigation_keyword`;
CREATE TABLE `tbl_cms_navigation_keyword` (
  `id` varchar(32) NOT NULL COMMENT '主键',
  `url` varchar(255) DEFAULT NULL COMMENT 'url',
  `navigation_id` varchar(32) NOT NULL COMMENT '关联的导航频道ID',
  `order_sn` tinyint(4) DEFAULT NULL COMMENT '排序号',
  `is_display` tinyint(4) DEFAULT '1' COMMENT '是否启用，1 - 启用；0 - 停用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `parent_id` varchar(32) DEFAULT NULL COMMENT '上级关键字ID',
  `keyword_type` tinyint(4) DEFAULT '0' COMMENT '关键字类型：0 - 关键字, 1 - 分类',
  `link_open_type` tinyint(4) DEFAULT '0' COMMENT '链接打开方式：0 - 新窗口打开; 1 - 原窗口打开',
  `keyword_name` varchar(255) DEFAULT NULL COMMENT '关键字名称',
  `color` varchar(7) DEFAULT NULL COMMENT '导航文本颜色RGB值',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='导航栏目关键词表';

